import React from 'react'
import Slider from 'react-slick';

const Testimonial = () => {
  return (
    <Slider>
        <div className="testimonial">
            Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ipsa, recusandae. Harum, officia quaerat optio quo quisquam corrupti voluptas ea adipisci, quas veniam, iste asperiores tempora laudantium nesciunt odio assumenda pariatur!
        </div>
    </Slider>
  )
}

export default Testimonial
